THE DAY I WAS BORN oh yes..... what an amazing show by the boys here. chills still run though me every time i hear them go into dark star. it's almost as if they get right to where they're gunna do it...the crowd gets excited, and then u think oh...almost....so close... i thought i almost heard- OH MY GOD!!! its dark star. you go wild. u and the rest of the crowd just know what they're witnessing here in 1989. it's the reason you went to dead shows, just hopeing, just wishing, that maybe...just this once they'd travel back and do it they way that go them there. and they do. 

me n bobby both have a pretty damn amazing birthday show if 'ya ask me. 

grateful birth 8}
